import React from "react";
import {
  View,
  Text,
  StyleSheet,
  FlatList,
  TouchableOpacity,
  ScrollView,
} from "react-native";
import { colors, fonts } from "@/theme";
import { AllocationUnits, units } from "@/utils/constant";
import UnitItem from "@/components/tabs/UnitItems";

const ProjectList = () => {
  return (
    <View>
      <ScrollView>
        <View style={styles.section}>
          <View>
            <Text style={styles.sectionTitle}>BRAVO</Text>
            <Text style={styles.desc}>
              Residential <View style={styles.dot} /> Toronto, ON
            </Text>
          </View>
          <View>
            <View style={styles.notification}>
              <Text style={styles.statusButtonText}>3</Text>
            </View>
          </View>
        </View>

        <FlatList
          data={units}
          keyExtractor={(item) => item.id}
          renderItem={({ item }) => <UnitItem item={item} />}
        />

        <View style={styles.section}>
          <View>
            <Text style={styles.sectionTitle}>SUGAR WHARF</Text>
            <Text style={styles.desc}>
              Residentia <View style={styles.dot} /> Toronto, ON
            </Text>
          </View>
          <View>
            <View style={styles.notification}>
              <Text style={styles.statusButtonText}>3</Text>
            </View>
          </View>
        </View>

        <FlatList
          data={AllocationUnits}
          keyExtractor={(item) => item.id}
          renderItem={({ item }) => <UnitItem item={item} />}
        />
      </ScrollView>
    </View>
  );
};

const styles = StyleSheet.create({
  section: {
    padding: 16,
    flexDirection: "row",
    justifyContent: "space-between",
  },
  sectionTitle: {
    fontSize: 16,
    fontWeight: "700",
    lineHeight: 24,
    color: colors.primary,
    fontFamily: fonts.calibri.bold,
  },
  desc: {
    fontSize: 14,
    fontWeight: "400",
    lineHeight: 20,
    color: colors.gray,
    fontFamily: fonts.calibri.regular,
  },
  notification: {
    padding: 6,
    height: 40,
    width: 40,
    alignItems: "center",
    borderRadius: 100,
    borderColor: colors.disablebutton,
    borderWidth: 1,
    marginRight: 8,
    backgroundColor: colors.white,
  },
  dot: {
    height: 2,
    width: 2,
    borderRadius: 50,
    padding: 3,
    backgroundColor: colors.gray,
    marginHorizontal: 5,
  },
  statusButtonText: {
    fontSize: 16,
    fontWeight: "400",
    lineHeight: 24,
    color: colors.black,
    fontFamily: fonts.calibri.regular,
    textAlign: "center",
  },
});

export default ProjectList;
